(704, 'Kajian Ketahanan Cekaman Kemasaman pada Beberapa Klon Lidah Buaya', 'DIPA DIKTI (Fundamental)', 2011, '1', '', 'Keragaman yang terdapat pada bibit lidah buaya ini selanjutnya dievaluasi dan dikarakterisasi sebagai dasar untuk menggolongkan klon-klon tersebut menjadi klon unggul lidah buaya.\nPenelitian tahun 1 (2011) telah dilakukan\n', 'Keragaman yang terdapat pada bibit lidah buaya ini selanjutnya dievaluasi dan dikarakterisasi sebagai dasar untuk menggolongkan klon-klon tersebut menjadi klon unggul lidah buaya.\nPenelitian tahun 1 (2011) telah dilakukan di lapangan yaitu desa Rasau Jaya II dengan jenis tanah gambut, tingkat kematangan safrist dengan pH 3,5-4,2 menggunakan metode rancangan acak kelompok. Pengamatan dilakukan terhadap beberapa sifat seperti pertambahan jumlah pelepah, umur mulai keluar pelepah daun baru (hari), perubahan morfologi daun dan akar dibandingkan dengan tanaman normal (tanpa EMS), warna daun, berat (g) pelepah panen pertama, dan jumlah pelepah yang dapat dipanen, serta variabel penunjang berupa kepekaan terhadap hama penyakit.\nHasil penelitian diperoleh Terjadi variasi pada klon-klon lidah buaya pada stadia bibit, sebagai pengaruh bawaan dari stadia kultur dan klon E4, E8 dan E7 dapat dijadikan klon harapan untuk menghasilkan klon baru yang tahan cekaman kemasaman.\n\nKata kunci: Lidah buaya, tahan, kemasaman', 0, 10, 1, '3', 178, 0, 0, 0, 0, ''),
