(2148, 'Pola Pengembangan Electronic Commerce Business to Consumer (E-Commerce B2C) sebagai Faktor Sukses bagi Usaha Kecil & Menengah (UKM) di Kota Pontianak', 'DIPA UNTAN (Hibah Bersaing Th III)', 2011, '1', '', 'Tujuan dari penelitian ini adalah untuk mengetahui tentang profil UKM yang ada di Kota Pontianak, kondisi kesiapan (e-readiness) dilihat dari infrastruktur yang dimiliki, antara lain: infrastruktur telekomunikasi, infras', 'Tujuan dari penelitian ini adalah untuk mengetahui tentang profil UKM yang ada di Kota Pontianak, kondisi kesiapan (e-readiness) dilihat dari infrastruktur yang dimiliki, antara lain: infrastruktur telekomunikasi, infrastruktur teknis, kapasitas sumberdaya manusia, akses terhadap teknologi komunikasi dan informasi, delivery option, infrastruktur finansial, metode pembayaran, social and psychological factors dan sistem hukum.\nPenelitian ini bersifat kualitatif eksploratif, di mana yang menjadi populasi adalah seluruh UKM yang berada di Kota Pontianak yang memproduksi barang-barang tahun lama yang bersifat unik/khas daerah kalimantan barat seperti miniatur Tugu Khatulistiwa, mandau, Rumah adat Dayak dan Melayu atau makanan khas daerah; yang memungkinkan produknya dijual di luar kota Pontianak atau ke luar negeri. Selain itu anggota masyarakat yang berpotensi untuk menjadi pembeli dalam transaksi secara online. Pengambilan sampel dilakukan secara Purposive Sampling baik untuk UKM maupun responden dengan jumlah 20 UKM dan 100 orang responden. Pengumpulan data dilakukan dengan melakukan wawancara, kajian dokumen dan observasi.\nKekhawatiran dan keengganan responden untuk berbelanja secara online dapat diatasi dengan cara memberikan informasi yang benar dan lebih banyak lagi kemudahan bertransaksi secara online melalui media massa, sehingga akhirnya banyak orang menjadi familiar, percaya dan merasa dimudahkan dengan transaksi di dunia maya.\n\nKata Kunci: e-Commerce B2C, e-Readiness, UKM, infrastruktur.', 0, 2, 2, 2, 117, 0, 0, 0, 0, ''),
(2149, 'Model Pemasaran Relasional dalam Dual Banking Sistem', 'DIPA UNTAN (Hibah Bersaing Th III)', 2011, '1', '', 'Recently, the focus of organizations consideration has moved from strategic design to recruitment of new customer and made transcation with them in an effort of maintaining the existing customers and building long-term r', 'Recently, the focus of organizations consideration has moved from strategic design to recruitment of new customer and made transcation with them in an effort of maintaining the existing customers and building long-term relationship with the customers, this is called relationship marketing. Loyalty is the purpose of relationship marketing that is built not only by satisfaction, but also trust and commitment as key mediator in building loyalty.\nThe purpose of this research is to develop and analyze the model of relationship marketing in dual banking system. Research was conducted in BNI, BRI, Bank Mandiri, Bank Kalbar, Bank Muamalat, Bank Syariah Mandiri, BRI Syariah and Bank Kalbar Syariah at Pontianak. Data were collected by using questionnaires involving 184 respondents in Islamic banking dan 440 respondents in conventional banking. Variables was measures by 44 items using Likert scale from 1 to 5 in conventional banking. In addition, the Islamic bank added one variable named compliance which is measured by five items. So that the total items used in measuring the variables in Islamic banks amounted to 49 items. The relationship variables in this research was tested by using peth analysis.\nFindings from this research show that model study proposed a \"Relational Marketing Model In Conventional Banks\" as generally show the criteria of model fit. The hypothesis consists of H1 (CARTER -> Satisfaction), H2 (CARTER -> Trust) and H3 (CARTER -> Commitment). H4 (Satisfaction -> Trust), H5 (Satisfaction -> Commitment), H6 (Commitment -> Trust), H7 (Satisfaction -> Loyalty), H8 (Trust -> Loyalty Trust) and H9 (Commitment -> Loyalty). All the hypotheses include of 9 hypothesis proved significant. This model accurately describes that satisfaction, trust and commitment are the intermediate variables in creating loyalty.\nModel study proposed a \"Model Relational Marketing in Islamic Banks\" generally meet the criteria of model fit. There are three hypotheses that are not significant ie H1 (CARTER -> Satisfaction), H2 (CARTER -> Trust) and H3 (CARTER -> Commitment). Meanwhile, sixth hypotheses proved significantly H4 (Satisfaction -> Trust), H5 (Satisfaction -> Commitment), H6 (Trust -> Commitment), H7 (Satisfaction -> Loyalty), H8 (Trust -> Loyalty) and H9 (Commitment -> Loyalty). So, this model accurately describes that satisfaction, trust and commitment are the intermediate variables in creating loyalty.\n\nKey word: Relationship Marketing, Dual Banking System, coventional Banking, Syariah Banking, Service Quality, CARTER, Satisfaction, Trust, Commitment, Loyalty.', 0, 2, 2, 2, 121, 147, 0, 0, 0, 'Didik M. Nur Haris'),
(2150, 'Produksi Tepung Kulit Jeruk Siam Kaya Serat Pangan dan Antioksidan yang Mempunyai Efek Hipoglisemik dan Hipolipidemia pada Tikus Diabetes NIDDM', 'DIPA UNTAN (Hibah Bersaing Th II)', 2011, '1', '', 'Production of Tangerine peel poder rich of dietary fiber and antioxidant compound which hypogliceic and hypolipideic effect in NIDDM_Diabetic rats was conducted. The goal of this research is to investigate effect of vari', 'Production of Tangerine peel poder rich of dietary fiber and antioxidant compound which hypogliceic and hypolipideic effect in NIDDM_Diabetic rats was conducted. The goal of this research is to investigate effect of variety and technical processing toward physicochemical and functional properties of peel powder. The research was divided into two step: 1) Effect of Variety of Tangerine and Processing Technology toward Physicochemical and Functional Properties of Peel Powder. And 2) Effect of Solvent and Temperature Extraction of Extract Toward Antioxidant Activity, Total Phenol and Total Dietary Powder of Tangerine Peel. The results show that Terigas Variety has highes of Water Content, Carbohydrate and Crude Fiber Content of Fresh Peel is Terigas. Blanching technique cause decrease of water content but increasing in carbohydrate and crude fiber content for all variety. However, antioxidant activity, phenolic content showed highest in Siam Tebas then others and also total dietary fiber. Increasing of temperature extraction from 70 become 80 C produced higher of antioxidant activity and phenolic total compound also total dietary fiber but increasing until 90 C cause decreasing of all variables. Mehanolic solvent is an optimalsolvent to produce of powder.\n\nKeyword: Total Dietary Fiber, Antioxidant Activity, Phenolic Total Content, Siam Tebas, Terigas, SiamPontianak', 0, 2, 1, 3, 233, 215, 0, 0, 0, 'K. Ayu Sarwetini'),
(2151, 'Upaya Budidaya Ikan Ringau (Datnoides microlepis) sebagai Peluang Pengembangan Komoditas Baru di Koridor Taman Nasional Danau Sentarum', 'DIPA UNTAN (Hibah Bersaing Th III)', 2011, '1', '', 'One of fish species in corridor between Betung Kerihun and Danau Sentarum National Park had been overfishing is tiger fish (D. microlepis). For culture development of tiger fish it is required information of bio-ecology ', 'One of fish species in corridor between Betung Kerihun and Danau Sentarum National Park had been overfishing is tiger fish (D. microlepis). For culture development of tiger fish it is required information of bio-ecology and behavior aspect for example, growth pattern, food and feeding habits. The aim of this study is to assess bioecology and behavior of tiger fish corridor between BKNP and DSNP. This study area was divided to 2 observations station i.e: Labian and Ngaung Tapah rivers. Fish samples were counted, measured (total length and standard length) and weighed (wet weight with 10 g precision). Measuring of water quality factors were sampled at the same time as sampling of fish with third repeated/station. Water quality measurements were composed of water temperature, water depth, pH, transperence, dissolve oksygen, nitrate, phosphate and observation of plankton density. Food habit of tiger fish is determined by using occurence frequency and volemetric methods. Growth pattern is determined by using relation of total length and weight of fish. Result showed that fish samples that found in Labian and Ngaung Tapah rivers were medium size. Depending on the food kind in the natural conditons, the behavior of tiger fish varied. Stomatch contains consisted primarily of crustaceans, mollusks, worms, small fish and plants. Food habit of tiger fish is omnivorous. Meat of tiger fish contains high protein (42%) and also fiber 1,97%, fat 19,48%, vitamin A 1503,6 ug/100g and Vitamin E, 0,189%. Amino acid of tiger fish consisted are aspartat, glutamate, asparagyn, isoleusyn, leusyn and lysin. The parasite that found was Argulus sp. The water quality of Labian River is better than Ngaung Tapah River. pH and dissolved oxygen of Labian and Ngaung Tapah is low for living tiger fish. The abundant level of plankton in this area is high. The tiger fish have high tolerant to unsuitable environment factors.', 0, 2, 1, 3, 241, 866, 0, 0, 0, ''),
(2152, 'Kajian Ketahanan Cekaman Kemasaman pada Beberapa Klon Lidah Buaya', 'DIPA DIKTI (Fundamental)', 2011, '1', '', 'Keragaman yang terdapat pada bibit lidah buaya ini selanjutnya dievaluasi dan dikarakterisasi sebagai dasar untuk menggolongkan klon-klon tersebut menjadi klon unggul lidah buaya.\nPenelitian tahun 1 (2011) telah dilakukan\n', 'Keragaman yang terdapat pada bibit lidah buaya ini selanjutnya dievaluasi dan dikarakterisasi sebagai dasar untuk menggolongkan klon-klon tersebut menjadi klon unggul lidah buaya.\nPenelitian tahun 1 (2011) telah dilakukan di lapangan yaitu desa Rasau Jaya II dengan jenis tanah gambut, tingkat kematangan safrist dengan pH 3,5-4,2 menggunakan metode rancangan acak kelompok. Pengamatan dilakukan terhadap beberapa sifat seperti pertambahan jumlah pelepah, umur mulai keluar pelepah daun baru (hari), perubahan morfologi daun dan akar dibandingkan dengan tanaman normal (tanpa EMS), warna daun, berat (g) pelepah panen pertama, dan jumlah pelepah yang dapat dipanen, serta variabel penunjang berupa kepekaan terhadap hama penyakit.\nHasil penelitian diperoleh Terjadi variasi pada klon-klon lidah buaya pada stadia bibit, sebagai pengaruh bawaan dari stadia kultur dan klon E4, E8 dan E7 dapat dijadikan klon harapan untuk menghasilkan klon baru yang tahan cekaman kemasaman.\n\nKata kunci: Lidah buaya, tahan, kemasaman', 0, 10, 1, 3, 178, 0, 0, 0, 0, ''),
