(2442, 'Perdagangan Perempuan (Trafficking) Antar Negara di Kawasan Perbatasan Indonesia-Malaysia', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRACT\nThis research is based about a woman trafficking internation, which questoned why sexual exploitation in Entikong district, has been continued and difficult to end. To the answer question, the study employed qualitative descriptive approach in order to reveal such phenomena behind this tragic situation.\nUsing qualitative analysis, the research findings show that woman trafficking is driven both by internal and external motivations. Internal motivations is derived from woman’s goals to achieve a higher social status among its local community. Meanwhile, external motivation relates with financial burden experienced by most woman’s family, lower education and cultural similarity tragedy woman trafficking.\nThe research has identified both positive and negative effects of woman trafficking, either for woman and their family or for people in Entikong district. Through remmitance from their operation in Malaysia, the practice of trafficking stimulates economic life development of woman’s family in particular. However, many of them had been cheated, forced to be a prostitute, or even had received physical violence from Malaysia men who had employed them as illegal migrant workers.\nThe research also found that the difficulty to end the practice are caused by different perceptions about trafficking between actors involved in the practice, specifically the state apparatus and local community. On one hand the state apparatus percepts the cases of illegal migrant workers as matter of civil law, not as a from criminal law. On the other hand, woman, their family, and the local community percept it as a from of trafficking involving deception, and violence against women.\nThe research recommends several policies, among others local government and migrant workers agencies need to corporate in dealing with illegal migrant workers to the others countries.\nKey Word: Economic family, lower education women, and Social culture', 0, 10, 2, 5, 481, 478, 0, 0, 0, ''),
(2443, 'Sistem Familisme sebagai Sumber Motivasi Dasar Menentukan Sikap Perilaku Kewirausahaan Orang Cina Pontianak', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nOrang Cina dikenal memiliki kemampuan dan keunggulan untuk menggeluti berbagai bidang wirausaha yang menjadikan mereka dapat bersaing dan berhasil menjalankan roda perekonomian di berbagai tempat. Kemanapun mereka pergi, mereka selalu membawa serta adat istiadat sebagai falsafah hidupnya yakni faham familisme yang merupakan inti ajaran Konfusius. Berdasarkan penelitian sebelumnya (2007) diketahui bahwa sistem familisme masih teguh dan diterapkan dalam sosialisasi di lingkungan keluarga inti orang Cina Pontianak.\nFenomena selanjutnya yang menjadi amatan penelitian adalah dengan jumlah mencapai 150.540 orang (30,11%), sebagian besar orang Cina memberikan kontribusi yang besar pada jalannya roda perekonomian kota Pontianak. Keadaan ini setidaknya menunjukkan bahwa orang Cina memiliki kemampuan untuk membangun dan bersaing di bidang ekonomi serta memiliki spirit dan perilaku kewirausahaan. Sikap perilaku yang khas dari orang Cina ini kiranya dibentuk dan dikembangkan dalam waktu yang panjang melalui proses sosialisasi keluarga dalam menerapkan sistem familisme yang diajarkan Konfusius. Temuan penelitian ini menunjukkan bahwa proses internalisasi nilai-nilai melalui sosialisasi tersebut sangat mempengaruhi pembentukan watak dan sifat-sifat tertentu yang akhirnya dipraktekkan dalam berbagai kegiatan usaha orang Cina yang banyak mencapai sukses di berbagai bidang.\nSecara umum, sebagai negara sedang berkembang, Indonesia masih kekurangan wirausahawan. Hal ini tentu saja kurang menunjang kebutuhan pembangunan sektor ekonomi. Sejalan dengan kurangnya wirausahawan di negara kita tentunya diperlukan berbagai upaya. Salah satunya adalah untuk menemukan model hipotetis yang mungkin dapat diterapkan melalui pembelajaran untuk menumbuhkan sekaligus mengembangkan sikap positif terhadap wirausahawan, dengan harapan bahwa di kemudian hari banyak tumbuh wirausahawan baru yang dapat mendukung pembangunan ekonomi di Indonesia. Untuk itu diperlukan metode dan strategi bagi masyarakat untuk mengembangkan sikap kewirausahaan. Pendidikan sebagai proses memiliki arti yang sangat penting sehingga kajian terhadap proses ini penting dilakukan.\nProses pendidikan pada dasarnya merupakan komunikasi. Komunikasi budaya Cina berisi pengenalan budaya Cina, penanaman ajaran tentang berbagai norma harus dijadikan pedoman dalam menjalani kehidupan di masyarakat dimanapun mereka berada. Sehubungan dengan sikap perilaku kewirausahaan yang menjadi tiitk berat penelitian ini, maka dapat diungkapkan tentang bagaimana proses menumbuhkan serta mengembangkan sikap tersebut melalui proses pembelajaran secara turun-temurun pada orang Cina. Dengan menggunakan metode kualitatif, penelitian ini mampu mengungkap nuansa proses budaya dan belajar mengajar yang merupakan strategi udaya yang mampu menjadikan lingkungan pendidikan sebagai budaya pengembangan bagi kewirausahaan orang Cina.\nKata kunci: familisme, konfusius, sosialisasi, kewirausahaan, enterpreneurship', 0, 10, 2, 5, 479, 500, 533, 0, 0, ''),
(2444, 'Dampak Kemajuan Teknologi Informasi terhadap Pergeseran Sikap dan Perilaku Generasi Muda di Pontianak', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nSalah satu pilar yang menopang perkembangan suatu peradaban adalah aspek teknologi di samping beberapa aspek lain seperti aspek filsafat, ilmu pengetahuan, budaya dan agama yang saling berkaitan dan memiliki ketergantungan dalam membangun peradaban manusia. Perkembangan peradaban manusia diiringi dengan perkembangan cara penyampaian informasi/teknologi berinteraksi mengalami pertukaran budaya. Televisi sebagai media komunikasi yang sarat teknologi, telah memancing makna kesenangan, hiburan dan keanekaragaman kesenangan dalam masyarakat. Budaya yang dihantarkan oleh televisi ini diserap dan dipraktekkan dalam tingkah laku berinteraksi sehari-hari.\nFenomena kehidupan dalam berbagai aspek, akhirnya diintervensi oleh kemajuan di bidang teknologi komunikasi dan informasi menggiring perubahan yang secara dramatis dapat dilihat pada pergeseran dari cara hidup yang bersifat tradisional ke arah modern yang lebih cenderung mengadopsi peradaban Barat. Bersamaan dengan masuknya pengaruh budaya global, perlahan-lahan nilai-nilai yang mengakar pada budaya lokal, mulai memudar dan dianggap kuno serta dipandang tidak praktis terutama oleh kaum muda. Tanpa pengetahuan yang memadai dan pertimbangan yang bijak, semua orang secara serampangan ingin mengakses dan memiliki berbagai produk teknologi seperti, televisi, handphone, computer (internet) dan pada akhirnya berlomba-lomba untuk mengadopsi atau meniru-niru cara kehidupan budaya Barat/global tanpa mempertimbangkan kesesuaian lingkungan. Secara otomatis budaya lokal yang dianut sebelumnya mulai dipinggirkan tanpa selektif.\nSituasi ini akhirnya menyadarkan dan mendorong kita untuk kembali dan mempertahankan kekhasan budayanya serta kembali pada aqidah agama maupun nilai-nilai luhur kemanusiaan yang kian meluntur. Kesadaran ini menandai tumbuhnya pemikiran postmodern untuk menjawab berbagai permasalahan dan tantangan yang muncul dalam perkembangan peradaban manusia. Tak dapat dihindari teknologi informasi saat ini menggeser peran berbagai agen sosialisasi lain seperti keluarga, guru dan masyarakat dalam menanamkan nilai-nilai kehidupan serta pembentukan kepribadian seorang anak. Pengungkapan bagaimana teknologi informasi menimbulkan dampak pada perilaku kehidupan anak muda di kota Pontianak, akan dilakukan secara kualitatif agar dapat menangkap nuansa proses budaya dan makna pembelajaran terhadap nilai-nilai kehidupan secara mendalam.\nDengan demikian Dampak Teknologi Komunikasi dan Informasi menjadi kajian yang menarik untuk dijadikan penelitian dasar bila dikaji melalui paradigma Komunikasi Peradaban untuk menemukan akar permasalahan, guna mencari solusi dan mengantisipasi bagaimana memanfaatkan teknologi komunikasi dan informasi yang dapat memberikan manfaat secara maksimal dalam membangun peradaban manusia. Dengan menggunakan metode kualitatif, penelitian ini mampu mengungkap dampak negatif kemajuan teknologi informasi yang dilihat dari pergeseran sikap dan perilaku generasi muda.\nKata kunci: Teknologi Informasi, Globalisasi, Peradaban, Budaya, Sosial', 0, 10, 2, 5, 500, 494, 508, 0, 0, ''),
(2445, 'Analisis Perspektif Teori Atribusi Tentang Reaksi Mosional dan Harapan Sukses Siswa SMA terhadap Keberhasila dan Kegagalan Belajarnya (Studi sebagai Dasar Pengembangan Model Bimbingan Atribusional untuk Peningkatan Mutu Perilaku Belajar dan Hasil Belajar', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nLuaran penelitian ini adalah hipotesis-hipotesis baru yang dapat digunakan untuk memperkuat toeir-teori yang telh ada atau mengoreksi dan memberikan pemikiran baru mengenai atribusi siswa terhadap keberhasilan dan kegagalan belajarnya serta reaksi emosional dan harapan suksesnya. Dengan demikian, akan dapat terjadi reformulasi teori dan akhirnya dapat dilakukan pembentukan konsep baru. Sebanyak 400 siswa SMA di Kalimantan Barat dilibatkan sebagai subjek penelitan ini. Dengan menggunakan analisis faktor mendapati bahwa atribusi siswa ketika mengalami keberhasilan belajar berpandangan lenyebabnya berada pada diri sendiri, dapat dikendalikan, dan tergantung pada diri mereka. Konsistensi atribusi seperti ini ditunjukkan juga pada saat mereka mengalami kegagalan belajar. Reaksi emosional siswa ketika mengalami keberhasilan cenderung bangga, puas, tetapi adanjuga yang heran, sedangkan ketika mengalami kegagalan cenderung menyesal, merasa bersalah, dan geram. Adapun harapan sukses mereka dalam kondisi keberhasilan cenderung lebih tinggi ketimbang dalam kondisi kegagalan.\nKata-kata kunci: atribusi, reaksi emosional, harapan sukses', 0, 10, 2, 6, 558, 0, 0, 0, 0, ''),
(2446, 'Aspek Sosio-kultural Masyarakat Perbatasan terhadap Program Konversi Minyak Tanah ke LPG', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nProgram konversi minyak tanah ke LPG merupakan upaya pemerintah untuk mengurangi subsidi BBM yang cenderung terus meningkat. Tidak semua lapisan masyarakat bisa langsung beradaptasi dengan program konversi itu. Sejak pemerintah membatasi pasokan minyak tanah dan sulitnya mendapat pasokan gas, masyarakat di perbatasan mulai beralih ke sumber energi lain seperti penggunaan kayu bakar.\nPenelitian ini bersifat deskriptif dengan maksud menggambarkan keadaan kondisi subyek penelitian berdasarkan fakta yang ada. Bentuk penelitian ini adalah studi kasus untuk menyelidiki suatu kelompok masyarakat atau individu tertentu secara mendalam. Pengumpulan data dilakukan dengan metode observasi langsung, komunikasi langsung dan studi dokumenter. Alat pengumpulan data yang digunakan dalam penelitian ini adalah: Daftar cek (check list), pedoman wawancara (interview), angket, buku catatan dan arsip-arsip. Lokasi penelitian di daerah perbatasan Kalimantan Barat yang berbatasan langsung dengan negara tetangga Malaysia.\nDari hasil penelitian didapatkan bahwa penggunaan LPG merupakan pilihan masyarakat yang dilakukan karena kesadaran. Masyarakat berusaha menyesuaikan diri dengan perubahan ketersediaan sumber energi. Program konversi energi juga mempengaruhi pola penggunaan energi masyarakat perbatasan. Hasil dan pembahasan adalah hasilnya menunjukkan bahwa r-hitung atau rxy=0,84 dan r-tabel=0,254 atau 0,3412>0,254 sehingga membuktikan bahwa terdapat korelasi antara program konversi minyak tanah ke LPG dengan sosio kultural masyarakat. Namun program konversi minyak tanah ke gas hanya berpengaruh sebesar 72,25% terhadap sosio kultural masyarakat. Besaran lain ditentukan oleh variabel lain.\nKata kunci: konversi; sosio kultural; dan masyarakat perbatasan', 0, 10, 2, 6, 557, 0, 0, 0, 0, ''),
(2447, 'Perilaku Metakognisi Anak dalam Matematika: Kajian Berdasarkan Etnis dan Gender pada Siswa SMP di Kalimantan Barat', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nLuaran penelitian ini berupa temuan teori ataupun hipotersis yang mengungkap karakteristik aktivitas metakognisi anak dalam keterkaitannya dengan kemampuan akademis dalam bidang matematika yang dikaji dari perbedaan lingkungan, etnis dan gender. Penelitian ini adalah penelitian investigasi yang dapat dipandang sebagai bagian dari penelitian pengembangan tentang kemampuan metakognisi dalam matematika. Siswa yang terlibat sebagai partisipan berjumlah 219 siswa yang terbagi dalam empat etnis dan dua jenis kelamin. Instrumen yang digunakan berupa angket metakognisi, perangkat tes pemecahan masalah, dan pedoman wawancara. Sistematika penyajian analisis data disusun dengan menggunakan langkah analisis kuantitatif dan analisis kualitatif. Dari analisis deskriptif terdapat pengaruh etnis dan gender terhadap kemampuan pemecahan masalah matematika dan kemampuan metakognisi siswa. Namun dari uji statistik, yaitu dari hasil Post Hoc Test: disimpulkan kemampuan metakognisi untuk ke-empat etnis tidak memiliki perbedaan yang signifikan. Menggunakan uji t, untuk kemampuan pemecahan masalah dengan equal variance not assumed disimpulkan baik untuk siswa laki-laki maupun siswa perempuan, kemampuan pemecahan masalahnya tidak berbeda secara signifikan, kemampuan metakognisi disimpulkan untuk siswa laki-laki maupun siswa perempuan tidak berbeda secara signifikan, dan tidak ada interaksi antara etnis dan gender dalam kemampuan memecahkan masalah matematika, dan tidak ada interaksi antara etnis dan gender dalam kemampuan metakognisi siswa.\nKata kunci: metakognisi, Pemecahan Masalah Matematika', 0, 10, 1, 6, 649, 563, 0, 0, 0, ''),
(2448, 'Penelusuran Budaya dan Teknologi Lokal dalam Rangka Rekonstruksi dan Pengembangan Sains di Sekolah Dasar (Kajian Etosains dan Etnoteknologi terhadap Masyarakat Tradisional Lingkungan Pertanian Suku Melayu dan Dayak di Kabupaten Pontianak)', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nPendidikan sains dapat dikembangkan dengan bertumpu pada keunikan dan keunggulan suatu daerah, termasuk budaya dan teknologi lokal (tradisional). Penelitian ini bertujuan untuk mengidentifikasi dan mendeskripsikan budaya dan teknologi lokal masyarakat tradisional lingkungan pertanian suku Melayu dan Dayak di Kabupaten Pontianak yang masih diyakini dan digunakan dalam mempertahankan hidup, serta mengintegrasikan budaya dan teknologi lokal tersebut dalam pengembangan silabus berbasis budaya lokal. Pendekatan kualitatif melalui studi etnografi (kajian etnosains dan etnoteknologi) dengan penekanan pada kajian-kajian kritis dan interpretatif dilakukan dalam menelusuri budaya dan teknologi lokal masyarakat tradisional lingkungan pertanian suku Melayu dan Dayak dengan teknik observasi dan wawancara secara mendalam. Hasil penelitian menunjukkan bahwa dalam budaya dan teknologi lokal masyarakat tradisional lingkungan pertanian suku Melayu dan Dayak teridentifikasi konsep sains sekolah dasar dengan draft pengembangan silabus berbasis budaya lokal yang sesuai dengan budaya setempat.\nKata kunci: Budaya dan Teknologi Lokal, Suku Melayu, Suku Dayak, Rekonstruksi', 0, 10, 1, 6, 655, 605, 586, 0, 0, ''),
(2449, 'Karakteristik dan Aktivitas Bakteri Acetobacter sp Isolat Lokal dari Nira Nipah dalam Fermentasi Asam Asetat', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRAK\nBahan yang mengandung gula serta alkohol merupakan substrat yang baik untuk pertumbuhan Acetobacter sp. Aktivitas bakteri ini akan menghasilkan produk berupa asam asetat dan nata. Kandungan karbohidrat pada nir nipah cukup tinggi yaitu (13-15%), sehingga nira nipah merupakan media yang baik untuk pertumbuhan Acetobacter sp. Dari penelitian ini diperoleh 6 isolat (BAAI, BAA2, BAA3, BAA4, BAA5 dan BAA6) dengan karakter fenotipe yang sesuai dengan Acetobacter sp dengan ciri-ciri: mampu tumbuh pada media PYG+ethanol, morfologi koloni bakteri berwarna putih susu atau agak krem, sel berbentuk basil, gram negatif dan katalase positif. Isolat bakteri Acetobacter sp BAA6 memiliki toeransi yang tinggi terhadap kandungan ethanol. Pada konsentrasi ethanol 12,5%, isolat Acetobacter BAA6 mampu tumbuh dengan produksi asam asetat pada media nira nipah sebesar 2,2%. Total asam asetat yang dihasilkan pada medium produksi nira nipah dengan penambahan starter isolat BAA6 sebesar 8,7%, sedangkan pada kontrol (AE cair) kandungan asam asetat lebih rendah yaitu 4%. Isolat yang diperoleh belum mampu mensintesis ekstrapolisakarisa (lapisan nata).\nKata kunci: Karakteristik dan Aktivitas, Acetobacter, nira nipah, fermentasi, dan asam asetat', 0, 10, 1, 6, 606, 719, 835, 0, 0, ''),
(2450, 'Analisis Tindak Kekerasan terhadap Tenaga Kerj Wanita yang Bekerja di Sarawak Malaysia (Kasus Daerah Perbatasan Indonesia-malaysia di Entikong Kalimantan Barat)', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRACT\nThis study attempt to inquire and analyze violence act that often experienced by women labor originated from border area in Entikong West Kalimantan who worked in Sarawak. The subject involved 100 women who ever worked and still working in Sarawak. Subject was taken in Entikong and several big cities in Sarawak. The inquiry result showed that the main cause of violence act toward women labor was human resource factor of women labor such as education, skill, experience, environment adaptation, etc. In addition, among of the women labor users in Sarawak had character that demand job target excessively to their labor. The irresponsible broker who wandered around Entikong also contribute to high rate of violence act toward immigrant labor by forging labor identity, selling women labor by labor guise, and entice them with big salary. The lower level apparatus such as village head, sub district head, even immigration officer in Entikong also contribute by giving facility to brokers. The matter of law protection by government and labor service distributor had not yet implemented completely. There were a lot of reports from labors, but it was not followed up by apparatus and the distributor didn\'t responsible if the labor was treated unjustly.\nKata Kunci: Kekerasan, Tenaga Kerja Wanita', 0, 10, 2, 6, 654, 652, 0, 0, 0, ''),
(2451, 'Hubungan Kekerabatan Tumbuhan Kantong Semar (Nepenthes) Asal Kalimantan Barat Berdasarkan Karakter Fenotipik', 'DIPA UNTAN', 2009, '1', '', '', 'ABSTRACT\nNepenthes is one of carnivrous plants which very popular as ornamental plant. The objectives of this study was to identified of Nepenthes spp. according in phenotypic characters. The phenotypic characters observed were stem, leaves, inflorescence, flower, inflorescence, pitcher and tendril morphology. According to this inventory in C.A. Mandor and one of Nepenthes farming in Pontianak are N. ampullaria, N. gracillis, N. rafflesiana, N. reindawartiana, N. mirabilis and N. albomarginata. There are four cluster of Nepenthes that observed.', 0, 10, 1, 3, 199, 864, 0, 0, 0, ''),
(2452, 'Karakteristik Penularan dan Epidemiologi Papaya Ringspot Virus pada Pepaya di Lahan Gambut Kalimantan Barat', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRAK\nPepaya Pontianak dikenal luas sebagai penghasil aeka buah tropis. Salah satu buang unggulan asal Pontianak yaitu pepaya hawai. Sejak tahun 2006 pepaya hawai mengalami kerusakan hebat akibat ledakan penyakit PRSV. Saat ini hanya sebagan kecil perkebunan pepaya hawai yang tertinggal dan sebagian besar telah diganti dengan pepaya califlora. PRSV termasuk dalam genus potyvirus, ditularkan secara nonpersisten oleh aphid ke pepaya dan beberapa cucurbitaceae. Kisaran inang yang luas, menyebabkan ketersediaan sumber inokulum tetap terjaga.\nHasil pengujian karakterisasi penularan PRSV menunjukkan bahwa penularan PRSV darilapangan ke pepaya di rumah kasa memperlihatkan gejala berupa malformasi daun dan pemendekan batang. Namun penggunaan tanaman sakit ini sebagai sumber inokulum tidak berhasil ditularkan kembali ke pepaya maupun labu kuning. Hal ini menjukkan bahwa tanaman pepaya yang memperlihatkan gejala menyerupai PRSV bukan disebabkan oleh penularan virus, tetapi cenderung disebabkan faktor lingkungan.\nPengujian potensi cucurbitaceae sebagai sumber inokulum PRSV dilakukan dengan penularan secara mekanik dan bantuan vektor. Hasil penularan dengan bantuan vektor dari labu kuning sakit ke labu kuning lainnya menunjukkan bahwa satu ekor Aphis gossypii mampu menularkan virus dan mencapai tingkat efisiensi tertinggi dengan kepadatan populasi 7 ekor/tanaman. Periode akuisisi dan inokulasi terbaik yang diperlukan dalam penularan virus antar cucurbitaceae berturut-turut 7 dan 15 menit.', 0, 10, 1, 3, 239, 220, 0, 0, 0, ''),
(2453, 'Biologi Reproduksi dan Mekanisme Polinasi Species Anggrek Bulbophyllum spp. Asal Koridor Taman Nasional Betung Kerihun dan Taman Nasional Danau Sentarum', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRACT\nBulbophyllum (Orchidaceae), with 1.085 species is the largest genus in the orchid family. To support for Bulbophyllum development is needed some informations about reproduction biology and pollination mechanism\'s. The objectives of this study was to observed phenology and pollination processing of Bulbophyllum spp. in corridor between Betung Kerihun and Danau Sentarum National Parks. These Bulbophyllum were B. lobii, B. lasianthum. B. macranthum and B. pahudii. Result showed that flowering season of Bulbophyllum are not same. There are two flowering season groups: B. macranthum and B. lobii in one group and B. lasianthum and B. pahudii in other group. Most bulbophyllum species are epiphytic plants of the swamp and lowland forest. Most Bulbophyllum species in corridor TNBK and TNDS have flowers those are pollinated by flies belonging to Dipteran families: Calliphoridae, Milichiidae, and Tephritidae. B. macranthum is pollinated by Bactrocera albistrigata. Bactrocera is one of Tephritidae family, but B. lobii is not pollinated by it. The pollinator of B. lobii is known yet. Some species of Millichidae and Tephritidae families pollinated flowers of B. lasianthum and B. pahudii. Based on season flowering and kind of pollinator, hybridisation in natural condition may be done between B. lasianthum and B. pahudii.\nKey words: Bulbophyllum, Betung Kerihun NP, Danau Sentarum NP, Pollination, Reproduction', 0, 10, 1, 3, 208, 241, 0, 0, 0, 'Nofrita'),
(2454, 'Keragaman Anggrek Bulbophyllum spp.', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRACT\nBulbophyllum (Orchidaceae: Epidendroideae), is the largest genus in the orchid family. The distribution of Bulbophyllum over these areas is by no means even. The island of Borneo is probably the second richest area with 200 species. The objectives of this study was to identified of Bulbophyllum spp. according in phenotypic characters. The phenotypic characters observed were flower, inflorescence, pseudobulb, median sepal, petal and lip morphology. According to this inventory in corridor between Betung Kerihun and Danau Sentaum National Parks are B. macranthum, B. pahudii, B. lasianthum, B. epicrianthes, B. cirlihanensis, B. purpurascens, B. uniflorum, B. beccari and B. obtusipetalum.\nKata kunci: Bulbophyllum, RAPD, filogeni, fenotip', 0, 10, 1, 3, 205, 864, 254, 0, 0, ''),
(2455, 'Karakterisasi dan Indentifikasi Klon-klon Lidah Buaya Hasil Pemuliaan Secara Mutasi dengan EMS', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRACT\nObjective of the present study are to study response of Ethyl Methane Sulfonate (EMS) for Aloe vera tissue culture and indentification of morphological variation of Aloe vera planlets. The research were completely randomized design with five replication and five level of EMS concentrations as treatments. Variables observation were height of plant, number of leaf, number of shoots and morphological observed. The results of this research was 0,08% EMS planlets were mutation and get some somaclone variation.\nKey words: EMS, Aloe vera, tissue culture', 0, 10, 1, 3, 255, 0, 0, 0, 0, ''),
(2456, 'Mechanism of Antioxidation of Phenolic Compound in Myrmecodia sp. from West Kalimantan', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRACT\nMechanism of antioxidation of phenolic compound in Myrmecodia sp. from West Kalimantan was investigated. To study the effects of methylene blue on the photosensitized oxidation in linoleic acid systems, the concentration of methylene blue10, 20, 30 and 40 ppm (wt/v) was prepared in 0.03 M linoleic acid in methylene chloride systems. To study the effects of identified antiphotooxidant compound in Sarang Semut tubers on the photosensitized oxidation in linoleic acid in methylene chloride containing methylene blue as a sensitizer, the concentration of identified antiphotooxidant compound in Sarang Semut tubers 0.00x10^5; 0.25x10^5; 0.50x10^5; 0.75x10^5 and 1.00x10^5 M (wt/v) were prepared in 0.03 M linoleic acid in methylene blue containing 40 ppm methylene blue (wt/v). To study the effects of linoleic acid on the photosensitized singlet oxygen oxidation, the concentration of linoleic 0.03; 0.06 and 0.09 M (wt/v) were prepared in methylene chloride solvent containing 40 ppm methylene blue (wt/v) and 1.00x10^5 M (wt/v).\nThe methylene blue and linoleic acid concentration were produced signicantly increased of peroxide value on singlet oxygen oxidation of linoleic acid in methylene cloride systems during storage under 4000 lux fluorescent light for 3 h. The effect of identified antiphotooxidant compound in Sarang Semut tubers concentration on singlet oxygen oxidation of linoleic acid in methylene cloride systems during storage under 4000 lux fluorescent light for 5 h was produced significantly decrease. The ability of antiphotooxidant activity of identified antiphotooxidant compounds in Sarang Semut tubers was affected by concentration.\nKey words: antiphotooxidant, phenolic compound of Myrmecodia tubers, linoleic acid systems', 0, 10, 1, 3, 204, 247, 215, 0, 0, ''),
(2457, 'Uji Efektivitas Beberapa Jenis Arang Aktif dan Tanaman Akumulator Logam pada Lahan Bekas Penambangan Emas', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRACT\nPenambangan Enas Tanpa Izin (PETI) di daerah Mandor Kalimantan Barat menimbulkan peningkatan polutan berupa unsur-unsur logam berat pada permukaan tanah pada area bekas PETI, sehingga sangat berbahaya bagi kesehatan manusia, hewan dan tanaman. Tujuan penelitian ini adalah untuk mengetahui efektivitas jenis dan ukuran arang aktif yang berasal dari bahan baku tempurung kelapa, tempurung kelapa sawit dan sekam padi serta tanaman akumulator sawi hijau, sawi huma dan sawi pahit dalam menyerap logam berat Hg dan Cu. Rancangan penelitian menggunakan Rancangan Acak Kelompok Faktorial, dengan faktor jenis arang aktif dan faktor jenis sawi. Faktor jenis arang aktif terdiri dari: 1) arang aktif sekam padi (P), tempurung kelapa sawit (S) dan tempurung kelapa dalam (D), dan 2) faktor ukuran arang aktif 30 mesh (M1), 80 mesh (M2) dan 100 mesh (M3). Sedangkan sebagai faktor jenis sawi adalah sawi huma (Hm), sawi pahit (Ph) dan sawi hijau (Hj). Sehingga perlakuan penelitian sebanyak 27 perlakuan. Hasil yang diperoleh adalah arang aktif yang berasal dari bahan baku sekam padi menyerap Cu 6,95 ppm (setelah inkubasi), 4,85 ppm(tanah saat panen sawi) dan tempurung kelapa sawit menyerap Cu 7,08 ppm (setelah inkubasi), 4,77 ppm (tanah saat panen sawi), arang aktif berukuran 30 mesh lebih efektif menyerap Hg sebanyak 29,25 ppb (setelah inkubasi), 16,51 ppb (tanah saat panen sawi), sawi hijau lebih efektif menyerap logam berat Cu dan Hg yang terakumulasi ke daun tanaman masing-masing sebanyak 0,64 ppm dan 5,96 ppb, sawi huma menyerap Cu sebanyak 5,97 ppm (saat panen), 0,42 ppm (dalam akar) dan menyerap Hg sebanyak 16,64 ppb (saat panen), 6,64 ppb (dalam akar), sedangkan sawi pahit menyerap logam berat Cu sebanyak 4,67 ppm (saat panen), 0,53 ppm (dalam akar), Hg 14,19 (saat panen), 3,43 (dalam akar), tidak adanya interaksi antara jenis arang aktif, ukuran arang aktif (mesh) dan tanaman akumulator dalam menyerap logam berat Hg dan Cu.\nkata kunci: Arang aktif, sawi, Hg, Cu, dan polutan', 47, 10, 1, 3, 212, 272, 189, 0, 0, ''),
(2458, 'Desain dan Analisis Formal Sistem Terotomatisasi Berbasis Mode-mode Operasi dengan Colored Petri Net (CPN)', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRAK\nManajemen mode-mode operasi adalah salah satu faktor yang sangat penting dalam sistem-sistem terotomatisasi. Beberapa penuntun terdahulu untuk mendefinisikan dan merancang mode-mode operasi yang telah disusun baik oleh akademisi maupun praktisi hanya difokuskan pada sistem tersentral dan desain informal. Penggunan penuntun hanya pada sistem tersentral menyebabkannya tidak dapat digunakan pada sistem terdistribusi. Di samping itu, bentuk desain yang informal bersifat abstrak dan dapat menyebabkan kesalahan dalam implementasi ketika beberapa mode operasi dipertimbangkan dalam desain. Oleh karenanya evaluasi logika kendali menjadi sulit untuk dilakukan jika model dari desain adalah informal. Artikel ini mengajukan sebuah pendekatan baru pada perancangan sistem terotomatisasi berbasiskan mode-mode operasi dengan mempertimbangkan metoda formal, yaitu Colored Petri Net (CPN). Beberapa template desain yang diusulkan kemudian diverifikasi dan divalidasi. Hasil verifikasi menunjukkan ukuran model yang kecil, tidak terdapat deadlock, sistem dijamin akan dapat terus berjalan, dan keamanan perpindahan dari satu mode ke mode yang lain mudah dilakukan. Sebagai validasi, sebuah panel kendali dirancang dan diimplementasikan pada sistem kendali seleksi produksi pada skala laboratorium dengan bantuan programmable Logic Controller.\nKata kunci: Mode-mode operasi, sistem terotomatisasi, pendekatan formal, verifikasi dan validasi, kendali berbasis fungsi, Mekatronika', 0, 10, 1, 4, 365, 0, 0, 0, 0, ''),
(2459, 'Peningkatan Daya Saing Usaha Kecil dan Menengah Melalui Penerapan Teknologi Informasi dan Komunikasi', 'DIPA DIKTI', 2009, '1', '', '', 'ABSTRAK\nTujuan penelitian ini adalah untuk membangun sebuah model pengembangan Usaha Kecil dan Menegah (UKM) melalui penerapan teknologi informasi dan komunikasi yang didukung dengan keterampilan/pengetahuan sumber daya manusia yang tinggi. Pengkajian berbagai upaya meningkatkan pendapatan nilai tambah UKM dari berbagai sektor dibarengi dengan tersedianya sumber daya manusia yang memiliki kemampuan penguasaan teknologi informasi dan komunikasi, di samping didukung oleh permodalan, sarana dan prasarana produksi dan transportasi yang memadai perlu dilakukan untuk meningkatkan daya saing UKM.\nPenelitian ini menggunakan kombinasi pendekatan kuantitatif dan kualitatif untuk mencapai tujuan penelitian. Teknik pengumpulan data melalui multi sumber meliputi dokumentasi masing-masing UKM, wawancara, observasi langsung dan kuesioner. Sampel penelitian adalah 40 UKM di Kota Pontianak yang dipilih dengan menggunakan metode purposive sampling. Teknik analisis dilakukan dengan analisis deskriptif dan analisis regresi linier berganda.\nHasil penelitian menunjukkan bahwa tingkat pemanfaatan TIK di kalangan UKM masih rendah, sebagian besar UKM masih bertumpu pada penggunaan telepon/handphone yang digunakan hanya untuk kegiatan yang bersifat dasar. kemampuan SDM UKM dalam memanfaatkan TIK relatif masih rendah, hal ini ditunjukkan sebagai besar responden tidak memiliki staf yang berlatar belakang TIK, aktivitas mengikuti pelatihan kurang, kemampuan mengelola dan mengakses TIK juga lemah. Selain itu tingkat pemahaman terhadap TIK dan peranan lembaga riset dan pendidikan mempunyai peran yang signifikan dalam mendorong pemanfaatan TIK oleh UKM.\nKata kunci: UKM, Teknologi Informasi dan Komunikasi, Daya Saing', 0, 2, 2, 2, 141, 139, 0, 0, 0, ''),
